import React from "react";
import Avatar from "@material-ui/core/Avatar";
import Button from "@material-ui/core/Button";
import CssBaseline from "@material-ui/core/CssBaseline";
import TextField from "@material-ui/core/TextField";
import Grid from "@material-ui/core/Grid";
import LockOutlinedIcon from "@material-ui/icons/LockOutlined";
import Typography from "@material-ui/core/Typography";
import { useStyles } from "./style";
import Container from "@material-ui/core/Container";
import { yupResolver } from "@hookform/resolvers/yup";
import * as yup from "yup";
import { useDispatch, useSelector } from "react-redux";
import { useForm } from "react-hook-form";
import { actSignUpApi } from "./modules/action";
import { Link } from "react-router-dom";
import Alert from "@material-ui/lab/Alert";
import { ThemeProvider } from "@material-ui/styles";

const usedEmailAddress = [
  "test1@gmail.com",
  "test2@gmail.com",
  "@test3@gmail.com",
];

const schema = yup.object().shape({
  name: yup
    .string()
    .required("Full name is a required field !")
    .matches(/^([^0-9]*)$/, "Your name should not contain number !"),
  email: yup
    .string()
    .required("Email address is a required field !")
    .notOneOf(usedEmailAddress, "Email is already taken !"),
  password: yup
    .string()
    .required("Password is a required field !")
    .min(6, "Password must be at least 6 characters"),
  confirmPassWord: yup
    .string()
    .required("Confirm password is a required field !")
    .oneOf([yup.ref("password")], "Password must be the same !"),
});

const SignUp = () => {
  const classes = useStyles();
  const dispatch = useDispatch();
  const signUpReducer = useSelector((state) => state.signUpReducer);
  const { register, handleSubmit, errors } = useForm({
    mode: "onBlur",
    resolver: yupResolver(schema),
  });

  const onSubmit = (data) => {
    dispatch(actSignUpApi(data));
  };

  return (
    <Container component="main" maxWidth="xs">
      <CssBaseline />
      <div className={classes.paper}>
        <Avatar className={classes.avatar}>
          <LockOutlinedIcon />
        </Avatar>
        <Typography component="h1" variant="h5">
          Sign up
        </Typography>
        <form
          className={classes.form}
          onSubmit={handleSubmit(onSubmit)}
          noValidate
        >
          <Grid container spacing={2}>
            <Grid item xs={12}>
              <TextField
                variant="outlined"
                required
                fullWidth
                id="name"
                label="Full Name"
                name="name"
                autoComplete="hoTen"
                inputRef={register}
                error={!!errors.name}
                helperText={errors?.name?.message}
              />
            </Grid>
            <Grid item xs={12}>
              <TextField
                variant="outlined"
                required
                fullWidth
                id="email"
                label="Email Address"
                name="email"
                autoComplete="email"
                inputRef={register}
                error={!!errors.email}
                helperText={errors?.email?.message}
              />
            </Grid>
            <Grid item xs={12}>
              <TextField
                variant="outlined"
                required
                fullWidth
                name="password"
                label="Password"
                type="password"
                id="password"
                autoComplete="current-password"
                inputRef={register}
                error={!!errors.password}
                helperText={errors?.password?.message}
              />
            </Grid>
            <Grid item xs={12}>
              <TextField
                variant="outlined"
                required
                fullWidth
                name="confirmPassWord"
                label="Confirm Password"
                type="password"
                id="confirmPassWord"
                autoComplete="current-password"
                inputRef={register}
                error={!!errors.confirmPassWord}
                helperText={errors?.confirmPassWord?.message}
              />
            </Grid>
          </Grid>

          {/* In ra loi neu dang nhap that bai */}
          {signUpReducer.error ? (
            <Alert severity="error" className={classes.alert}>
              {signUpReducer.error.response.data.error}
            </Alert>
          ) : null}
          <Button
            type="submit"
            fullWidth
            variant="contained"
            color="primary"
            className={classes.submit}
          >
            Sign Up
          </Button>
          <Grid container justify="flex-end">
            <Grid item>
              <Link to="/sign-in" variant="body2">
                Already have an account? Sign in
              </Link>
            </Grid>
          </Grid>
        </form>
      </div>
    </Container>
  );
};

export default SignUp;
